import React, { useState , useEffect} from 'react';
import { Link } from 'react-router-dom';
import Logo from '../Logo/Logo';
import '../login/login.css'

const Login = () => {
const initialValues = {user_email:'', password:''};
const [formValues, setFormValues]= useState(initialValues);
const [formErrors, setFormErrors]= useState({});
const [isFormSumit, setIsFormSubmit]=useState();
const [user, setUser]=useState([])



  const handleChange =(e)=> {
    const {name, value} = e.target;
    setFormValues({...formValues, [name]:value})
  }

  const handleSubmit =(e)=>{
    e.preventDefault();
    setFormErrors(validate(formValues));
    setIsFormSubmit(true);
    postData();
    console.log(formValues)
  }
  const postData = () =>{

    //const data = {name:formValues.name, description:formValues.description, department_code:formValues.department_code}
    const requestOption ={
      method : "POST",
      headers: {'Content-Type': 'application/json'},
      body:JSON.stringify(formValues)
    }
    {
    fetch('http://localhost:5000/login', requestOption)
    .then((response) => response.json())
    .then((data) => {
      if(data.status==="success"){
        localStorage.setItem('user', JSON.stringify(data))
      }
    }  )
  }
  //window.location.reload(false);
  alert("user login succes")
  }



useEffect(() => {
  console.log(formErrors);
  if (Object.keys(formErrors).length === 0 && isFormSumit) {
    console.log(formValues);
  }
}, [formErrors]);


const validate = (values) => {
  const errors = {};
  console.log("error data", values);
  //const regex = /^[^\s@]+@[^\s@]+\.[^\s@]{2,}$/i;
  if(values.user_email===""){
    errors.user_email="Email is required";
  }
  if(!values.password){
    errors.password="Password is required";
  }
  return errors;
}

  return (
    <div>
      <div className="container">


        <div className="row justify-content-center h-100">

          <div className="col-xl-10 col-lg-12 col-md-9">

            <div className="card o-hidden border-0 my-5">
              <div className="card-body p-0">
                <div className="row d-flex align-items-center">
                  <div className="col-lg-6 offset-md-3">
                    <div className="p-3">
                      <div className="text-center">
                        <h1 className="h4 text-gray-900 mb-4"><Logo></Logo></h1>
                      </div>
                      <form className="user" >
                        <div className="form-group">
                          <input type="email" name='user_email' className="form-control form-control-user" value={formValues.email} onChange={handleChange} placeholder="Enter Email Address..." />
                          <p style={{color: "#FF0000"}}>{formErrors.email}</p>
                        </div>
                        <div className="form-group">
                          <input type="password" name='password' className="form-control form-control-user"
                          value={formValues.password} onChange={handleChange} placeholder="Password" />
                           <p style={{color: "#FF0000"}}>{formErrors.password}</p>
                        </div>
                        <div className='row'>
                          <div className='col-6'>
                          <div className="form-group">
                          <div className="custom-control custom-checkbox small">
                            <input type="checkbox" className="custom-control-input" id="customCheck" />
                            <label className="custom-control-label" htmlFor="customCheck">Remember Me</label>
                          </div>
                        </div>
                          </div>
                          <div className='col-6'>
                            <div className='forget-possword text-right'>
                            <Link to='/forgot-password' className="small">Forgot Password?</Link>
                            </div>
                          </div>
                        </div>

                        <button type='submit' className="btn btn-primary btn-user btn-block" onClick={handleSubmit}>Log In</button>



                      </form>

                      {/* <div className="text-center">
                        <Link to='/forgot-password' className="small">Forgot Password?</Link>
                      </div> */}
                      {/* <div className="text-center">
                        <Link to='/register' className="small" >Create an Account!</Link>
                      </div> */}
                    </div>
                  </div>
                </div>
              </div>
            </div>

          </div>

        </div>

      </div>
    </div>
  )
}

export default Login
